// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "./token/IERC721.sol";
import "./token/IERC20.sol";
import "./library/PRBMathUD60x18.sol";

import "./access/Ownable.sol";
import "./gsn/Context.sol";
import "./address/Address.sol";
import "./strings/Strings.sol";

contract gorvernance {

  address public erc20Token;
  address public erc721NFT;
  uint256 public feeAmount;

  address  public governance;
  address tokenAddress;
  address NFTAddress;

  struct moveItem {
    address mover; //발의인
    string title; //발의명
    string content; //발의안
    uint256 yes; //찬성
    uint256 no; //반대
    uint movedBlockNumber; // 시간 확인을 위한 발의 시 블록넘버
    bool isActive; // 활성화여부
    bool isApproved; // 통과여부
  }

  mapping(uint256 => moveItem) _moveItems; //발의호수
  uint256 totalMove; // 총 발의안 수

  mapping(uint256 => mapping(address => bool)) voter;


  event TokenPlaced(uint256 indexed tokenId,  uint256 cost);
  event TokenUnplaced(uint256 indexed tokenId);
  event TokenSold(uint256 indexed tokenId, address indexed newOwner);
  event checkthis(address approvedaddress, address thisaddress);
  event BalanceCheck(uint256 _balance);


  constructor (address _erc20Token,address _erc721NFT, address _governance) {
    totalMove = 0;
    erc20Token = _erc20Token;
    erc721NFT = _erc721NFT;
    governance = _governance;
  }

  function move(string memory title, string memory content, address ERC721NFT, address ERC20TOKEN) external  {
// 발의 시 고려해야 할 사항
// NFT 5개 이상이 의제 발의권
// 발의시 2000KANV 소각(재단지갑)
// 발의 주제 및 내용이 존재하는가?

    require(IERC20(ERC20TOKEN).balanceOf(msg.sender) >= 2000, "nope");
    require(IERC721(ERC721NFT).balanceOf(msg.sender) >= 5, "not enough NFT");
    require(bytes(title).length > 0 && bytes(content).length > 0,"nope3");

    IERC20(ERC20TOKEN).transferFrom(msg.sender, governance, 2000);
    totalMove += 1;
    _moveItems[totalMove] = (moveItem(msg.sender, title, content, 0, 0, block.number, true, false));


  }

  function votes(uint256 index, uint256 voting, bool yesOrNo) external {
// NFT 1개 이상이 참여권
// 투표권은 KANV 단위로 한다.
// 투표가 진행되는동안 NFT와 KANV 가 홀딩되어 있어야 한다.
// 투표 철회 기능
// 최소 참여 기준 설정(해당 투표 시작 당시 KANV 대비 일정 퍼센트 이상의 투표가 발생해야 유효한 투표로 인정할지)



      require(_moveItems[index].isActive == true, "Deactivated Item");
      require(voter[index][msg.sender] == false, "You Voted");

      require(IERC20(erc20Token).balanceOf(msg.sender) >= voting, "Exceed the number of votes : ");
      require(yesOrNo == true || yesOrNo == false, "Not a bool");


      voter[index][msg.sender] = true;

      if (yesOrNo == true){
          _moveItems[index].yes += voting;
      } else {
          _moveItems[index].no += voting;
      }
    }

  function closeVotes(uint256 index) external {
// 투표가 끝나면 상환

    moveItem memory item = _moveItems[index];
    require(item.isActive == true,"Deactivated item");
    require(item.movedBlockNumber + (0)<= block.number,"not yet");
    uint256 turnout = PRBMathUD60x18.div((item.yes + item.no), (IERC20(erc20Token).totalSupply() - IERC20(erc20Token).balanceOf(governance)));
    require(turnout >= 300000000000000000);

    if (item.yes > item.no){
        _moveItems[index].isActive = false;
        _moveItems[index].isApproved = true;
    }  else if (item.yes < item.no){
        _moveItems[index].isActive = false;
        _moveItems[index].isApproved = false;
    } else if (item.yes == item.no){
        _moveItems[index].movedBlockNumber += 3600*24; // 찬반 같은경우 1일 연장?
    }
  }



  function checkMove(uint256 index) public view returns (uint256, uint256){
    return (_moveItems[index].yes, _moveItems[index].no);
  }

  function checkActive(uint256 index) public view returns (bool){
    return (_moveItems[index].isActive == true);
  }

  function checkEnd(uint256 index) public view returns (bool){
    return (_moveItems[index].movedBlockNumber + (3600 * 24 * 7)>= block.number);
  }

  function checkItem(uint256 index) public view returns (moveItem memory){
    return _moveItems[index];
  }
}
